    false,nt"url": null,nt"notes": "The instructions outlined here will provide
    uniform methods for measuring total predator activity in blocks of nesting cover
    or at special kinds of nest sites. The objective may be simply to learn whether
    predation rates are "excessive", or it may involve treatments and comparisons.
    The latter may be oriented toward cover, habitat, nest site, productivity rate,
    predators, weather and climate, time, or total environment. Although this guide
    provides some advice about statistical problems and data analysis, a statistician
    should be consulted if the results of the experiment will be used in formal reports
    or published papers. This meeting should take place at the planning stage; not delayed
    until field work is under way. One should keep in mind that he is essentially counting
    contacts between an egg-eating bird or animal at a series of particular "spots"
    in the environment. From these contacts one gets an index to total predator activity.",nt"owner_org":
